    render(){

        const { value: password }  = async () => await Swal.fire({
            title: 'Enter your password',
            input: 'password',
            inputLabel: 'Password',
            inputPlaceholder: 'Enter your password',
            inputAttributes: {
              maxlength: 10,
              autocapitalize: 'off',
              autocorrect: 'off'
            }
          })

          if (password) {
            Swal.fire(`Entered password: ${password}`)
          }


    const style = {
        "text-align": "left",
        "padding-top": "8%",
    };

    const contentStyle = {
        "width": "80%",
        "position": "relative"
    }

    const H2Style ={
        "position": "relative",
        "font-family": "'Righteous', cursive"
    }

        return (
            <div>

                <div class="top-down">

                <nav class="navbar navbar-expand-lg" id="top-navbar" style={style}>
                    <div class="collapse navbar-collapse" id="navbarNav">
                        <div style={contentStyle}>
                            <h2 style={H2Style}> {this.props.Title} </h2> 
                            <a href="" class="nav-link"> <AddIcon/> Add a work! </a>
                        </div>
                    </div>

                </nav>

                </div>

            </div>

        );
    }
}

export default HeadTag
